package ru.spb.devpractices.masterbest.serverside.model.order;public enum OrderStatus {    New ("Новый", false),    Viewed("Просмотрен",false),    Accepted("Принят",false),    Inwork("В работе",false),    Suspended("Приостановлен",false),    Rejected("Отклонен",true),    Completed("Завершен",true),    Falsevisit("Ложный вызов",true),    Notfinished("Сборка приостановлена",true)    ;    private Boolean isHistoryStatus;    private String description;    OrderStatus(String description, boolean isHistoryStatus) {        this.description = description;        this.isHistoryStatus = isHistoryStatus;    }    public Boolean isHistoryStatus() {        return isHistoryStatus;    }    public String getDescription() {        return description;    }}